import React, { Component } from 'react';
import './App.css';
import img from '../public/noun_V60pourover.png'

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img  src={img} alt ="placeholder"/>

        </header>
      </div>
    );
  }
}

export default App;
